def de_bruijn_graph(k, text):
    graph = {}
    for i in range(len(text) - k + 1):
        kmer = text[i:i+k]
        prefix = kmer[:-1]
        suffix = kmer[1:]
        if prefix in graph:
            graph[prefix].append(suffix)
        else:
            graph[prefix] = [suffix]
    return graph


k =12
text=''
result = de_bruijn_graph(k, text)
for key in sorted(result.keys()):
    print(key + ": " + " ".join(result[key]))
